import React, { Component } from 'react';

import Button from '@material-ui/core/Button';
import { Box, Menu } from '@material-ui/core';

class Shop extends Component {
    state = {  }
    render() { 
        return (
            <Box>
                <Menu></Menu>
                <Button variant="contained" color="primary">
                    Hello World
                </Button>
            </Box>
        );
    }
}
 
export default Shop;
